import React, { Component } from "react";
import SearchItem from "./SearchItem";

export default class SearchList extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      searchTitle: ""
    };
  }
  render() {
    return (
      <div className="search-results">
        <ul>
          {results.map(game => (
            <li>
              <SearchItem game={game}></SearchItem>
            </li>
          ))}
        </ul>
      </div>
    );
  }
}
